import React, { Component } from 'react';
import { Table } from 'reactstrap';

class TableHeader extends Component {
    render() {
        return (
            <div>
            <Table>
                <thead>
                    <tr>
                        <th>Set #</th>
                        <th>% of max</th>
                        <th>Reps</th>
                        <th>Weight</th>
                        <th>Load each side</th>
                    </tr>
                </thead>
            </Table>
            </div>
        )
    }
}

export default TableHeader;
